script{{{
export function ftsify(split_string, min_length = null, max_length = null) {
    if (typeof(split_string) != 'string' || typeof(sprint_string) == null) {
        return;
    }
    var split_string_array = split_string.toLowerCase().split(/\W+/);
    var return_array = new Array();
    for (var i = 0; i < split_string_array.length; ++i) {
        return_array.push(create_substrings(split_string_array[i], min_length, max_length));
    }

    var place_holder_array_due_to_bug = new Array();
    place_holder_array_due_to_bug = create_return(return_array.flat());
    return new Set(place_holder_array_due_to_bug);
}

export function create_substrings(_string, min_length, max_length) {
    var i, j, result = [];
    var size = (min_length || 0);
    var max_size = (max_length ?? _string.length);
    for (i = 0; i < _string.length; i++) {
        for (j = _string.length; j - i >= size; j--) {
            if (_string.slice(i, j).length <= max_size) {
                result.push(_string.slice(i, j));
            }
        }
    }
    return result;
}

export function create_return(_array) {
    var return_array = new Array();
    if (typeof(_array[1]) == 'string') {
        var newArray = _array.slice();
        newArray.unshift(0);
        return newArray;
    } else {
        var newArray = _array.slice();
        newArray.push("");
        return newArray;
    }
}
}}}
select company, 
		arbitrary(slice(_script.ftsify(company, 2, 8), 2)) as company_search 
from _input 
group by company

script {{{
export function create_seed_array(input_array){
const alpha = Array.from(Array(26)).map((e, i) => i + 65);
const alphabet = alpha.map((x) => String.fromCharCode(x).toLowerCase());
var array1=alphabet;
var array2=alphabet;
var alpha_array = array1.flatMap(d => array2.map(v => d + v))
var out_array = alphabet.concat(alpha_array)
var term_map = {};
for (const i in out_array) {
term_map[out_array[i]] = 0
}
for (const r in input_array) {
var cur_val = term_map[input_array[r]]
cur_val = cur_val + 1
term_map[input_array[r]] = cur_val
}
const ordered = Object.keys(term_map).sort()
var vector = [];
var index = 0
for (const v in ordered){
vector[index] = term_map[ordered[v]]
index = index + 1
}
return vector
}
}}}
select
_script.create_seed_array(ARRAY_CONCAT(ngrams(REGEXP_REPLACE(LOWER(i."Child's First Name"), '''|\s'), 1), ngrams(REGEXP_REPLACE(LOWER(i."Child's First Name"), '''|\s'), 2))) as name_embedding,
CAST("Count" AS INT) as name_count,
CAST("Rank" AS INT) as name_rank,
*
EXCEPT (_meta)
FROM _input i

