WITH base AS (
  SELECT
    i.*
  except(id),
    to_base64(md5(taxi_id)) as taxi_id,
    PARSE_TIMESTAMP(
      '%m/%d/%Y %I:%M:%S %p',
      i.start_timestamp,
      'America/Chicago'
    ) as start_timestamp,
    PARSE_TIMESTAMP(
      '%m/%d/%Y %I:%M:%S %p',
      i.end_timestamp,
      'America/Chicago'
    ) as end_timestamp,
    ST_GEOGPOINT(i.pickup_latitude,i.pickup_longitude) as pickup_geo,
    ST_GEOGPOINT(i.dropoff_latitude,i.dropoff_longitude) as dropoff_geo,
  	_script.ftsify(i.company, 2, 8) as company_search,
    trip_id as _id
  FROM
    _input i
)
SELECT
  b.*,
  b.start_timestamp AS _event_time,
  EXTRACT(
    YEAR
    FROM
      b.start_timestamp
  ) as start_year,
  EXTRACT (
    MONTH
    FROM
      b.start_timestamp
  ) as start_month,
  EXTRACT(
    DAY
    FROM
      b.start_timestamp
  ) as start_day,
  EXTRACT(
    DOW
    FROM
      b.start_timestamp
  ) as start_dow,
  EXTRACT(
    ISOWEEK
    FROM
      b.start_timestamp
  ) AS start_week,
  EXTRACT(DATE FROM b.start_timestamp) as start_date,
  UNIX_SECONDS(b.start_timestamp) / 86400 as start_epoch_date,
  ROUND(b.tips / b.trip_total * 1000) / 10.0 AS tip_pct
FROM
  base b

